import React from "react";
// import Potato from "./Potato";
import PropTypes from "prop-types";


function Food({ name, picture, rating }) { //Food라는 컴포넌트 함수
  return ( //JSX 문법으로 반환
    <div>
      <h2>I like {name} </h2>
      <h4>{rating}/5.0</h4>
      <img src={picture} alt={name}/>
    </div>
  )
}

const foodLike = [
  {
    id: 1,
    name: 'Kimchi',
    image: 'data:image/jpeg;base64,',
    rating: 5,
  },
  {
    id: 2,
    name: 'Bibim',
    image: 'data:image/jpeg;base64,',
    rating: 3,
  },
  {
    id: 3,
    name: 'Doncasu',
    image: 'data:image/jpeg;base64,',
    rating: 4.5,
  }
]

function renderFood(dish) {
  return <Food name={dish.name} picture={dish.image} />
}

//renderFood 함수의 화살표 함수 작성ver
// const renderFood = dish => <Food name={dish.name} picture={dish.image} />

Food.propTypes = {
  name: PropTypes.string.isRequired,  //모든 props는 문자열이고 반드시 있어야한다.
  picture: PropTypes.string.isRequired,
  rating: PropTypes.number.isRequired,
}

function App() {
  console.log(foodLike.map(renderFood))
  return (
    <div>
      {foodLike.map(dish => (<Food key={dish.id} name={dish.name} picture={dish.image} rating={dish.rating}/>))}
    </div>

  )
}

export default App;
